    Key = X bsl N + Acc,
    case Key of
        10 ->
            'd_field_map<string,bytes>_key'(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
        18 ->
            'd_field_map<string,bytes>_value'(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
