            case Key band 7 of
                0 ->
                    'skip_varint_map<string,bytes>'(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData);
                1 ->
                    'skip_64_map<string,bytes>'(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData);
                2 ->
