                        Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData
                    );
                3 ->
                    'skip_group_map<string,bytes>'(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData);
                5 ->
                    'skip_32_map<string,bytes>'(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData)
            end
    end;
