    '-infinity';
fj_float(S) when is_list(S) ->
    case fj_d_num2e(S, integer, "") of
        {integer, S2} -> float(list_to_integer(S2));
        {float, S2} -> list_to_float(S2)
    end.

-compile({nowarn_unused_function, fj_d_num2e/3}).
fj_d_num2e("-" ++ Rest, St, Acc) ->
    fj_d_num2e(Rest, St, "-" ++ Acc);
fj_d_num2e("+" ++ Rest, St, "" = Acc) ->
    fj_d_num2e(Rest, St, Acc);
fj_d_num2e([D | Rest], St, Acc) when $0 =< D, D =< $9 -> fj_d_num2e(Rest, St, [D | Acc]);
fj_d_num2e("." ++ _ = S, _, Acc) when Acc =:= ""; Acc =:= "-" -> fj_d_num2e(S, float, "0" ++ Acc);
fj_d_num2e("." ++ [D | _] = S, _, Acc) when $0 =< D, D =< $9 -> {float, lists:reverse(Acc, S)};
fj_d_num2e("." ++ Rest, _, Acc) ->
    {float, lists:reverse(Acc, ".0" ++ Rest)};
fj_d_num2e([E | _] = Rest, integer, Acc) when E == $e; E == $E ->
    {float, lists:reverse(Acc, ".0" ++ Rest)};
fj_d_num2e("", St, Acc) ->
    {St, lists:reverse(Acc)}.

fj_string(S) when is_binary(S); is_list(S) -> unicode:characters_to_binary(S).

fj_bytes(S) when is_binary(S); is_list(S) ->
    B64 = <<
        <<
            if
                C =:= $- -> $+;
                C =:= $_ -> $/;
                true -> C
            end
        >>
     || <<C>> <= iolist_to_binary(S)
    >>,
    base64:decode(B64).

fj_mk_msg(Values, _MsgName, FieldInfos, TrUserData) ->
    fj_mk_msg2(Values, FieldInfos, #{}, TrUserData).

fj_mk_msg2([V | VRest], [{Key, _RNum, _D, Tr} | FRest], Msg0, TrUserData) ->
    V1 =
        if
            Tr =:= id -> V;
            true -> fj_tr(Tr, V, TrUserData)
        end,
    Msg1 = Msg0#{Key => V1},
    fj_mk_msg2(VRest, FRest, Msg1, TrUserData);
fj_mk_msg2([], _FRest, Msg, _TrUserData) ->
    Msg.

fj_tr(Tr, V, TrUserData) when is_function(Tr) -> Tr(V, TrUserData);
fj_tr({r_tr, InitTr, AddElemTr, FinalizeTr, ElemTr}, L, TrUserData) ->
    InitAcc = InitTr([], TrUserData),
    FinalizeTr(fj_r_tr(L, InitAcc, AddElemTr, ElemTr, TrUserData), TrUserData).

fj_r_tr([Elem | Rest], Acc, AddElemTr, ElemTr, TrUserData) ->
    Elem1 = ElemTr(Elem, TrUserData),
    Acc1 = AddElemTr(Elem1, Acc, TrUserData),
    fj_r_tr(Rest, Acc1, AddElemTr, ElemTr, TrUserData);
fj_r_tr([], Acc, _AddElemTr, _ElemTr, _TrUserData) ->
    Acc.

fj_ensure_list(B) when is_binary(B) -> binary_to_list(B);
fj_ensure_list(S) when is_list(S) -> S.

